import React, { useState, useEffect } from 'react';
import { ShoppingCart, Youtube, Instagram } from 'lucide-react';
import { Link } from 'react-router-dom';

const Header = () => {
  const [hoveredNav, setHoveredNav] = useState(null);
  const [isDropdownVisible, setIsDropdownVisible] = useState(false);

  const handleNavEnter = (title) => {
    setHoveredNav(title);
    setIsDropdownVisible(true);
  };

  const handleNavLeave = () => {
    setIsDropdownVisible(false);
  };

  return (
    <div className="relative" onMouseLeave={handleNavLeave}>
      <header className="w-full bg-black">
        {/* Top Bar */}
        <div className="w-full px-4">
          <div className="flex justify-between items-center h-12">
            {/* Left side with social icons and title */}
            <div className="flex flex-col items-start">
              <h1 className="text-white w-[90px] h-[15px] mb-2 text-sm leading-none">
                2025 KUAD GRADUATION FASHION SHOW
              </h1>
              <div className="flex gap-4">
                <a href="https://youtube.com" target="_blank" rel="noopener noreferrer">
                  <Youtube className="w-[15px] h-[15px] text-white" />
                </a>
                <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
                  <Instagram className="w-[15px] h-[15px] text-white" />
                </a>
              </div>
            </div>

            {/* Cart Icon */}
            <div>
              <button className="relative">
                <ShoppingCart className="w-[15px] h-[15px] text-white" />
              </button>
            </div>
          </div>

          {/* Logo */}
          <div className="text-center py-4">
            <Link to="/" className="inline-block w-[310px] h-[40px] text-white font-bold text-5xl leading-none">
              SOMA
            </Link>
          </div>
        </div>

        {/* Navigation */}
        <nav className="border-t border-b border-gray-800">
          <div className="mx-auto" style={{ width: '1140px' }}>
            <ul className="flex justify-center gap-20 py-4">
              {['PROJECT', 'STORE', 'SHOW INFO', 'BEHIND', 'ARCHIVE'].map((item) => (
                <li
                  key={item}
                  className="relative group"
                  onMouseEnter={() => handleNavEnter(item)}
                >
                  <Link 
                    to={`/${item.toLowerCase()}`} 
                    className="inline-block w-[130px] h-[20px] text-white text-base font-medium hover:text-gray-300 relative text-center"
                  >
                    {item}
                    <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-white transition-all duration-200 group-hover:w-full"></span>
                  </Link>
                </li>
              ))}
            </ul>
          </div>
        </nav>
      </header>

      {/* Dropdown Menu */}
      {isDropdownVisible && hoveredNav && (
        <div 
          className="absolute w-full bg-white z-50 shadow-lg transition-all duration-300 ease-in-out"
          onMouseEnter={() => setIsDropdownVisible(true)}
        >
          <div className="mx-auto px-8 py-12" style={{ width: '1140px' }}>
            <div className="flex justify-between items-start">
              <div className="w-1/3">
                <h3 className="text-3xl font-bold text-black mb-6">{hoveredNav}</h3>
                <p className="text-gray-600 text-base leading-relaxed">
                  {/* Description content */}
                </p>
              </div>
              <div className="w-1/4">
                <ul className="space-y-6">
                  {/* Sub items content */}
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Header;
